(1, 'Footer Links', 'footer_links', '\n<ul>\n    <li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\n    <li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2015-09-01 12:24:29', '2015-09-01 12:24:29', 1),
(2, 'Footer Links Company', 'footer_links_company', '<div class="links">\r\n<div class="block-title"><strong><span>Company</span></strong></div>\r\n<ul>\r\n<li><a href="{{store url=""}}about-us/">About Us</a></li>\r\n<li><a href="{{store url=""}}contacts/">Contact Us</a></li>\r\n<li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\r\n<li><a href="{{store url=""}}privacy-policy/">Privacy Policy</a></li>\r\n</ul>\r\n</div>', '2015-09-01 12:24:29', '2015-09-07 15:53:06', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2015-09-01 12:24:29', '2015-09-01 12:24:29', 1);
