INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', NULL, '\n<div class="page-title"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class="disc">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class="disc">\n            <li><a href="#" onclick="history.go(-1); return false;">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a>\n            <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n', '2015-09-01 12:24:29', '2015-09-01 12:24:29', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Jamdani Ville', 'homepage', NULL, NULL, 'home', NULL, '<section class="block">\r\n<div id="myCarousel" class="carousel slide">\r\n<div class="carousel-inner">\r\n<div class="active item"><img alt="" src="{{skin url=''images/1.jpg''}}" /></div>\r\n<div class="item"><img alt="" src="{{skin url=''images/2.jpg''}}" /></div>\r\n</div>\r\n<a class="carousel-control left" href="#myCarousel" data-slide="prev">&lsaquo;</a> <a class="carousel-control right" href="#myCarousel" data-slide="next">&rsaquo;</a></div>\r\n</section>\r\n<!-- end the slider -->\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-sm-1">&nbsp;</div>\r\n<div class="col-sm-10">\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Jamdani</div>\r\n{{block type="catalog/product_list" category_id="4" template="catalog/product/cat_product_list.phtml"}}\r\n<div class="pull-right"><a class="view_all" href="http://www.jamdaniville.com/index.php/sarees/dhakai-jamdani.html">View all</a></div>\r\n<div class="clearfix">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end cat list -->\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-sm-1">&nbsp;</div>\r\n<div class="col-sm-10">\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Moslin</div>\r\n{{block type="catalog/product_list" category_id="5" template="catalog/product/cat_product_list.phtml"}}\r\n<div class="pull-right"><a class="view_all" href="http://www.jamdaniville.com/index.php/sarees/moslin-jamdani.html">View all</a></div>\r\n<div class="clearfix">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end cat list -->\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-sm-1">&nbsp;</div>\r\n<div class="col-sm-10">\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Tangail Taant</div>\r\n{{block type="catalog/product_list" category_id="6" template="catalog/product/cat_product_list.phtml"}}\r\n<div class="pull-right"><a class="view_all" href="http://www.jamdaniville.com/index.php/sarees/tangail-taant.html">View all</a></div>\r\n<div class="clearfix">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end cat list -->\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-sm-1">&nbsp;</div>\r\n<div class="col-sm-10">\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Salwar-Kameez</div>\r\n{{block type="catalog/product_list" category_id="7" template="catalog/product/cat_product_list.phtml"}}\r\n<div class="pull-right"><a class="view_all" href="http://www.jamdaniville.com/index.php/salwar-kameez.html">View all</a></div>\r\n<div class="clearfix">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end cat list -->\r\n<p>&nbsp;</p>\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-sm-1">&nbsp;</div>\r\n<div class="col-sm-10">\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Accessories</div>\r\n{{block type="catalog/product_list" category_id="10" template="catalog/product/cat_product_list.phtml"}}\r\n<div class="pull-right"><a class="view_all" href="http://www.jamdaniville.com/index.php/accessories.html">View all</a></div>\r\n<div class="clearfix">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end cat list -->', '2015-09-01 12:24:29', '2015-09-15 17:45:12', 1, 0, '<!--<reference name="content">\r\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name="right">\r\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
(3, 'About Us', 'two_columns_right', NULL, NULL, 'about-us', NULL, '<h3>About Jamdani Ville</h3>\r\n\r\n<h4>Who we are: </h4>\r\n<p>Jamdani Ville is a global online shop, Which is  offering the Bangladeshi Hand Loom woven fabric. Mainly we provide Jamdani, which is the addition of Muslin, the historical heritage of Mughol Period. </p>\r\n\r\n<h4>Our Mission:</h4>\r\n<p>Our mission is to spread our great heritage #Jamdani and it''s fame all over the world .</p>\r\n\r\n<h4>About Product:</h4>\r\n<p>We bring our Jamdani directly from our weavers, which is situated at Rupgonj, Narayinganj. Our main specialties are high quality materials and unique design. </p>\r\n\r\n<h4>About Customer</h4>\r\n<p>Each and every customer is our asset and the most important part of our business. We believe in good relationship with our customers, That''s why we highly care about their satisfaction. </p>\r\n<p>And we know satisfaction comes out from the product quality ,service and trust. So we always try to provide the best service and high quality product with very reasonable  price.</p>', '2015-09-01 12:24:29', '2015-09-08 11:55:57', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
